before_layer_change_gcode:
{if layer_num == 1}
{if is_extruder_used[0] and is_extruder_used[1]}
; Desired bed temperatures: {bed_temperature[0]} and {bed_temperature[1]}
M140 S{bed_temperature[0] > bed_temperature[1] ? bed_temperature[0] : bed_temperature[1]}
{else}
{if is_extruder_used[0]}
M140 S{bed_temperature[0]}
{else}
M140 S{bed_temperature[1]}
{endif}
{endif}
{endif}

machine_start_gcode:
M83          ; Relative Extruder mode

M98 P"/sys/prepare-to-print.g" H{is_extruder_used[0] ? first_layer_temperature[0] : 0} I{is_extruder_used[1] ? first_layer_temperature[1] : 0} B{is_extruder_used[0] ? first_layer_bed_temperature[0] : 0} C{is_extruder_used[1] ? first_layer_bed_temperature[1] : 0}

T{initial_tool}
